window.bookSummaryJSON = "<p><b>With my core enhanced by runes of power, I'm progressing faster than any cultivator in Acalia.</b></p> <p>Headed to defeat the Forest Tower, Astra, Brea, Minh and I are ready for whatever this strange world can throw at us. Unfortunately, not all is right in Acalia. With another tower to climb, monsters to kill, and rival cultivators testing me, I'm going to have my hands full. Unforeseen allies and a gorgeous new companion are exactly what we need to make the climb.</p> <p>May the Towers watch over us all.</p> <p>This novel includes elements of lite LitRPG, Isekai, cultivation, and magic harem relationships.</p>"; 
